(67, 'Sirisak.ji@gmail.com', 'ศิริศักดิ์ อุดมหรรษากุล', '0828244545', 'ขอรบกวนเวลาดูเบอร์ให้สักนิดได้มั้ยคับ\r\nผมทำงานเป็นผู้บริหาร เกี่ยวกับโบรคเกอร์ประกัยภัย และกำลังติดต่อไปทำงานที่ลาว เกี่ยวกับ ไฟแนนซ์ ผมมี 3 เบอร์มีที่ใช้อยากทราบว่าดีหรือไม่\r\n1. 085-325-5554\r\n2. 082-824-4545\r\n3. 088-969-5559\r\nส่วนของแฟนทำงานเป็นผู้จัดการฝ่ายขายรถยนต์ เบอร์ \r\n1. 082-447-4449\r\n2. 083-666-4499\r\n3. 089-098-7887 \r\nเลขไหนควรหรือไม่ควรใช้ รบกวนได้มั้ยคับ ขอบพระคุณคับ', '2012-10-17 06:10:41'),
