(69, 'csurachate@msn.com', 'สุรเชษฐ์', '-', 'สอบถามครับว่า คนวันจันทร์ใช้เลข 1 ได้หรือไม่ครับ เพราะเคยอ่านพบว่าดาว 1 เป็นกาลกิณีของวันจันทร์ แต่ผมผูกดวงมีดาว 1 (มหาจักร) กับดาว 5 (เกษตร) เด่นครับ เลยอยากเอามาไว้ในเบอร์ทั้งสองตัว แต่ไม่แน่ใจว่าถ้าเอา 1 มาจะส่งผลเสียหรือไม่และเคยอ่านพบว่าถ้าเลี่ยงไม่ได้ก็ให้เพิ่มเป็น2ตัว ผมขอความเห็นอาจารย์หน่อยครับ', '2012-10-20 21:39:25'),
(70, 'artandidesign@gmail.com', 'กวิศรา', '0846556939', 'สวัสดีค่ะ คุณพรพิฆเณศว์ \r\n\r\nขอแนะนำตัวนิดนึงนะคะ ดิฉันชื่อกวิศรานะคะ ที่คุณโทรมาเมื่อเช้า (เคยฝากคำถามในเว็บบอร์ดของคุณตามลิงค์ข้างล่าง)\r\nขอบคุณที่แนะนำนะคะ ...แม่นจนน่าตกใจ\r\nhttp://www.magiciannumber.com/webboard_detail.php?webboard_id=34\r\n\r\n\r\nคุณบอกว่าถ้าสนใจดูเรื่องชื่อ ก็เมลล์มาถามคุณได้\r\nเลยลองเมลล์มา เพราตั้งแต่เปลี่ยนชื่อมา ดิฉันวุ่นวายมากจริงๆ\r\nขอโทษที่เสียมารยาทนะคะ อยากถามเหลือเกินว่า นี่เรื่องบังเอิญ หรือว่า ทราบได้อย่างไร???\r\n\r\n\r\nเรื่องชื่อ \r\nดิฉันเกิดวันพฤหัสค่ะ  \r\nตอนนี้ชื่อ กวิศรา อรุณเรือง ค่ะ\r\nคือตั้งแต่เกิดก็ชื่อนี้ล่ะค่ะ ----------ต่อมาเปลี่ยนเป็นอริศรา เพราะมีผู้ใหญ่ท่านนึงทักว่าไม่ดี  เหมือนจะบอกว่าเป็นมูลละทำให้ชีวิตหนักๆหรืออย่างไรไม่ทราบ \r\nตอนนี้ เปลี่ยนกลับมาใช้ชื่อเดิม(กวิศรา)เมื่อเดือนที่แล้ว  เปลี่ยนเสร์จก็เลิกกับแฟน และตรวจเจอซีสต์....อะไรจะบังเอิญปานนั้น???? \r\nสรุปสั้นๆคือ กวิศรา-----> อริศรา-----> กวิศรา นะค่ะ\r\n\r\nสาเหตุที่กลับมาใช้ชื่อเดิม(กวิศรา)  เพราะดิฉันก็ไม่ค่อยเชื่อเรื่องแบบนี้เป็นทุนเดิมอยู่แล้ว/ชอบชื่อเดิมๆตั้งแต่เกิดมากกว่า  อีกอย่างคือในหน่วยงานดิฉันชอบอ่าน/จำชื่อดิฉันแปลกๆ ผิดๆบ่อยๆ เช่น เรียกฉันว่า อิสระ...ซึ่งออกแนวเป็นชื่อผู้ชายมากกว่า ปัญหาคือ เวลาเขียนชื่อเบิกค่าตอบแทน เบิกชุด จัดห้องให้ กลายเป็นของผู้ชายหมดเลย(เค้าเรียกดิฉันว่าจ่าอิฐค่ะ) ดิฉันเบื่อที่จะต้องตามแก้ เลยแอบไปเปลี่ยนกลับ  จะมีก็แต่ทางบ้านที่ไม่เห็นด้วย  \r\n\r\n\r\n\r\nตามที่ได้พูดคุยกับคุณตอนเช้า\r\nขออภัยนะคะ ที่พูดไม่ค่อยรู้เรื่องเท่าไหร่ สติยังไม่มา..ตามประสาคนป่วยแหละค่ะ ถ้ามีอะไรที่ล่วงเกินคุณไปบ้างก็ขออภัยนะคะ\r\n\r\nจากเลขมือถือ 088 883 3866\r\nคุณบอกว่าดิฉันเป็นคนกวนๆ ชวนหาเรื่อง พูดเสียงดัง รายจ่ายเยอะ\r\n..................ค่ะ ก็เป็นแบบนั้นจริงๆ หัวหน้า เคยบอกว่า ดิฉันแมนกว่านายทหารทุกคนในกองมัดรวมกัน \r\n\r\nและที่บอกว่าจะมีปัญหาช่องท้อง มดลูก\r\n..................ค่ะ วันก่อน ดิฉันพึ่งไปผ่าซีสต์ในมดลูกมา....ยังนอนโรงบาลอยู่เลย\r\n\r\n\r\nส่วนเรื่องความรัก \r\nอันนี้ไม่ค่อยแม่นเท่าไหร่(ขออภัยนะคะ) \r\nดิฉันพึ่งเลิกกับแฟน(ที่คบกันมาเกือบ7ปีแล้ว) ช่วงปลายกันยาปีนี้นี่เองค่ะ \r\n\r\nที่บอกไม่แม่นคือ คุณบอกว่าคนนั้นเป็นเพื่อนของดิฉัน ที่จริงไม่ใช่ค่ะ เราไม่รู้จักกัน  แต่รู้จักกับอดีตแฟนของดิฉันค่ะ(สองคนนั้นทำงานที่เดียวกัน)\r\nดิฉันพักในค่ายค่ะ  ไกลจากที่ทำงานอดีตแฟนค่อนข้างมาก(คนละอำเภอ) เค้าเลยขอไปออยู่หอพักใกลๆที่ทำงาน...สรุป ย้ายไปอยู่ด้วยกันซะเลย ว่างั้นเถอะ\r\nดิฉันจับได้  เค้าก็เกือบตายคาคอมแบทนั่นแหละ :-) \r\nไม่อยากเล่าเลย เดี๋ยวคุณจะมองว่าฉันร้าย???\r\n\r\n\r\nส่วนที่คุณบอกว่า ระวังคนมีเจ้าของจะมาชอบ???\r\nอันนี้คงตรงบ้างบางส่วนค่ะ อาจจะเป็นเพราะที่ทำงาน ส่วนใหญ่เป็นผู้ชาย จะมีผู้หญิงก็ไม่กี่คนหรอก  \r\nโดนแซวบ้างเป็นเรื่องธรรมดา(คิดเอง)  ส่วนมากเป็นคนที่ไม่รู้จักค่ะ  เพราะถ้ารู้จักกันจริงๆ ไม่ค่อยกล้ามายุ่มย่ามเท่าไหร่  อย่างที่คุณบอกแหละค่ะ ดิฉันค่อนข้างดุเอาเรื่องเหมือนกัน\r\n\r\n\r\nส่วนเรื่องงาน\r\nดิฉันพึ่งรับราชการไม่นานค่ะ(สองปีเศษ)  ก่อนหน้านี้ทำงานสายการบิน \r\nซึ่งก็อย่างที่คุณบอก  เข้ามาแรกๆ ค่อนข้างมีปัญหา...ไม่ใช่จากงานนะคะ แต่มาจาก เพื่อนร่วมงาน และบรรดาแม่บ้าน... ซึ่งก็คงเดาไม่ยากว่าเรื่องเป็นยังไง\r\nแต่ตอนนี้ไม่มีแล้วค่ะ  เหมือนทุกคนจะรู้แล้วว่าดิฉันเป็นคนยังไง  ถ้าจะมีแซวๆบ้าง ก็เป็นกับคนที่มาติดต่องานจากที่อื่น หรือทหารใหม่ๆนั่นแหละค่ะ \r\nซึ่งก็น่าแปลกใจตรงว่า งาน+ชีวิตส่วนตัว(บางส่วน) พึ่งจะมาลงตัว ก็เมื่อต้นปีนี้(ตรงกับช่วงใช้เบอร์ใหม่พอดี..084 655 6939)\r\n\r\n\r\nดิฉันลองเอาเบอร์เก่าๆ( ที่ใช้มานาน(ตั้งแต่ทำงานการบิน) มาลองดูในเว็บคุณ  เป็นเบอร์ที่ใช้มานานมาก(เกือบสิบปีแล้ว) \r\n95% ของคำทำนาย ...ตรงมากค่ะ   ยังคิดเลยว่าเป็นเรื่องบังเอิญไปมั้ย???  อุตส่าห์เปลี่ยนเบอร์ใหม่ก็ยังออกมาเป็นแบบเดิมอีก \r\nอาจจะเป็นเพราะตัวเลขมันวนๆแต่กับตัวเดิมๆหรือเปล่า เพราะส่วนตัวเป็นคนชอบเลข3/6/8 มากๆ  \r\nเบอร์เก่าเป็นเบอร์คะแนน-31ค่ะ เหนื่อยมาก และตรงมากจนน่าตกใจ \r\n\r\n\r\nตอนนี้เบอร์088 883 3866 ก็ยังใช้บ้างประปรายค่ะ \r\nเมื่อก่อนใช้เป็นเบอร์หลัก แต่ปัญหาคือเหนื่อยกับการตอบคำถาม ประมาณว่า อะไรนะ 8กี่ตัว???   \r\nถ้าจะใช้ ส่วนมากเอาไว้โทรตาม-sms หาลูกค้าค่ะ\r\nดิฉันทำธุรกิจขายของ pre order กับเพื่อนที่ยังเป็นแอร์อยู่  แต่ก็คงจะค่อยๆพยายามเลิกใช้\r\nเพราะไม่ค่อยมีใครโทรหาเบอร์นี้อยู่แล้ว ถ้าจะมีเหตุให้ต้องโทร ส่วนมากจะเป็นเรื่องที่ทำให้อารมณ์เสียทั้งนั้นแหละค่ะ.........\r\n\r\n\r\n\r\n\r\n\r\nขอบคุณสำหรับคำแนะนำนะคะ\r\nพึ่งจะมารู้จากเว็บคุณนี่แหละว่าเป็นคนที่ดื้อมากๆ ไม่เคยฟังใครนี่เป็นข้อเสีย(อย่างมาก)????\r\nปกติไม่คิดว่าเป็นข้อเสียหรอกค่ะ คิดแต่ว่าเป็นข้อดีที่ตัวเองเข้มแข็ง และมั่นใจในตัวเอง... \r\nพอได้มาป่วย ได้อยู่นิ่งๆ ก็มีเวลาได้คิดทบทวนอะไรเยอะ\r\n\r\n ขอโทษนะคะ เมลล์ยาวไปหน่อย ขอโทษที่ทำให้เสียเวลา แต่ก็อยากเล่าให้ชัดๆไปเลย \r\n\r\nขอบคุณอีกครั้งนึงค่ะ\r\nกวิศรา', '2012-10-24 12:44:50'),
