(149, 'teenoi_you@hotmail.com', 'ปริญญา หงษ์ทอง', '085-955-3979', 'สวัสดีครับพี่\r\nวันเกิด เสาร์ที่ 6 พ.ย. 2525 เวลา 7:41 น.\r\nตอนนี้เป็นมาร์เกตติ้งหุ้น กำลังพยายามฝึกเทรดเพื่อเป็นนักลงทุน-เทรดเดอร์อิสระ(เทรดสินค้าพวกฟิวเจอร์-ออฟชั่นทั้งไทยและต่างประเทศ)\r\n\r\nผมเน้นส่งเสริมการเงิน เพื่อน และ ที่สำคัญช่วยให้ผมเป็นนักลงทุน-เทรดเดอร์ที่ประสบความสำเร็จได้อย่างดีครับ\r\n\r\nผมกำลังเลือกเบอร์\r\nระหว่าง 088-914-2656 และ 082-416-6656\r\nในใจคิดไว้ว่าจะเลือก 082-416-6656 \r\nก็เลยอยากจะถามตามหลักวิชาของพี่แล้ว เบอร์ไหนดีกว่ากันครับ \r\n\r\nส่วนตัวคิดว่า 2 เบอร์นี้เหมือนกัน 70% มีต่างกันนิดหน่อยตรงที่เบอร์ 088 น่าจะเหนื่อยกว่าเบอร์ 082 ไม่รู้ผมเข้าใจผิดรึเปล่า เลยขอรบกวนถามพี่หน่อยนะครับ\r\n\r\nขอบคุณครับ\r\nตี๋ 085-955-3979 \r\n', '2013-06-20 16:48:27'),
