(152, 'teenoi_you@hotmail.com', 'ปริญญา หงษ์ทอง', '0859553979', 'ผมชื่อ ปริญญา หงษ์ทอง\r\n\r\nเกิดวันเสาร์ที่ 6 พ.ย. 2525 เวลา 7:41 น.\r\nบ้านที่จังหวัด ฉะเชิงเทรา เลขที่ 9 \r\n\r\nคอนโดที่พักอยู่ปัจจุบัน 97/262\r\n\r\nทะเบียนรถที่ขับประจำ 1กย 536\r\n\r\nกำลังเลือกเบอร์ระหว่าง \r\n\r\n082-416-6656 และ 088-914-2656 อยากจะถามว่าสองเบอร์นี้แตกต่างกันอย่างไร เบอร์ไหนมีกำลังส่งเสริมมากกว่ากัน เบอร์ไหนสะดวกสบายกว่ากัน สิ่งที่เน้นตอนนี้คือ ชีวิตผมปัจจุบันค่อนข้างโอเค แต่การเงินผมเลี้ยงได้แต่ตัวเอง มะสามารถดูแลคนอื่นๆได้ ประกอบกับอยากมีรถมีบ้านแล้ว กะเลยอยากเพิ่มเรื่องเงิน และปัจจุบันผมอาชีพมาร์เกตติงหุ้น และกำลังพยายามฝึกฝนให้เก่งจนสามารถออกมาเทรดเป็นเทรดเดอร์-นักลงทุนอิสระ เทรดฟิวเจอร์-ออฟชั่นในต่างประเทศและในประเทศ อยากประสบความสำเร็จในระดับสูง พัฒนาตนเองได้ต่อเนื่อง มีเวลาสำหรับทำสิ่งที่ตัวเองชอบและมีเวลาดูแลคนอื่นๆได้ และถ้ามีโอกาสก็อยากช่วยคนอื่นๆด้วย\r\n\r\nและอยากถามว่าเวลาเลือกเบอร์ห้ามเลขอะไร และเลขไหนเป็นมงคลดี\r\n\r\nอีกคำถามถ้าผมอยากศึกษาศารตร์โหร เช่นเรื่องตัวเลข เรื่องดวงดาว อาจารย์ช่วยแนะนำหนังสือหรืออาจารย์ที่คอยสั่งสอนให้คำปรึกษาได้มั้ยครับ\r\n\r\nขอบคุณครับ\r\nตี๋\r\n085-955-3979', '2013-06-22 01:52:03'),
