(192, 'thanet.jsbas@gmail.com', 'ธเนศ อัศวกาญจนกิจ', '0904194168', 'อยากสอบถามครับ\r\nตอนนี้ผมมีเบอร์โทรสับอยู่ 3 เบอร์\r\nคือ \r\n\r\n0904194168 อันนี้เบอร์หลัก พกตลอด\r\n\r\n0867886660 อันนี้เป็นเบอร์รอง\r\n0880086168 อันนี้สำรอง\r\nสองเบอร์ล่างจะอยู่ในมือถือ 2 sim\r\n\r\nซึ่งเบอร์หลักจะใช้ติดต่อทั่วไป ธุรกิจ ลูกค้า\r\n\r\nส่วน2เบอร์ล่างไว้ใช้ติดต่อเพื่อนฝูงหรือตนในบ้านที่ใช้เครือข่ายเดียวกัน (โทรถูก)\r\n\r\nเลยอยากให้วิเคราะห์ให้หน่อยครับ\r\nว่าเปนอย่างไร\r\nและถ้าควรเปลี่ยนควรจะอย่างไร และใช้เบอร์ไหน\r\n\r\nส่วนตัวทำงานอยู่ 2 ประเภทหลักๆ\r\n1 ทำธุรกิจที่บ้านเป็นงานฝีมือ และต้องออกไปออกบูธค้าขายบ่อยๆ \r\n2 เป็นงานดนตรี เป็นครูสอนดนตรี นักแต่งเพลง และโปรดิวเซอร์ \r\n\r\nคือเรียนจบสายดนตรีมาก และดนตรีเป็นตัวตนที่สุด รักงานนี้มาก \r\nในขณะเดียวกัน งานที่บ้านก็รักไม่แพ้กัน\r\nชิวิตจึงแบ่งงานเป็นสองส่วน \r\nดนตรีก้รักและขาดไม่ได้ ส่วนงานที่บ้าน\r\nก็รักและต้องรับผิดชอบในการเตรียมตัวและขยายกิจการที่บ้านให้โตขึ้น\r\n\r\nรบกวนด้วยชี้แนะด้วยครับ\r\nขอบคุณครับ', '2013-08-21 14:30:35'),
