(328, 'pura-ta@hotmail.com', 'นางสาวหทัย  ปุรณะพรรค์', '0885221366', 'ตามที่ท่านได้มีsms แจ้งให้หนูเพิ่มเติมเวลาเกิด ทะเบียนรถ เลขที่บ้าน แล้วส่งให้ท่าน\r\n1.เวลาเกิด  08.30 น.\r\n2.ทะเบียนรถยนต์  มี 2 คัน  สีดำทั้งสอง\r\n    - ชช.7325\r\n  - กค.7325   \r\n3.ทะเบียนรถจักรยานยนต์  995\r\n4.เลขที่บ้าน 30 \r\n\r\n               ขอบพระคุณค่ะ        \r\n\r\n                     \r\n ', '2014-04-04 08:08:01'),
(329, 'j.veerachat@gmail.com', 'วีระฉัตร์ จิตประเสริฐ', '0815658263', 'พอดี อยากซื้อเบอร์ให้ภรรยาใช้ครับ เค้าเป็นนักกฏหมาย กำลังจะเปลี่ยน ช่วงเดือนหน้า เป็นคนต่างชาติ ชื่อ เหริงฮวา น่า  เหมาะที่จะใช้เบอร์ที่ผมจองไว้มั้ยครับ 0 9 5 5 3 5 5 6 1 6\r\n\r\n', '2014-04-08 17:26:21'),
(330, 'top-t2527@hotmail.com', 'ณัฏฐ์ศศิ  เฉื่อยทอง', '0809805659', 'อยากรู้เรื่องรอบตัวทุกเรื่องเช่น การงาน การเงิน ชีวิตคู่ และเรื่องครอบครัว บ้านที่ต่างจังหวัด ว่าเป็นอย่างไรบ้าง', '2014-04-09 22:36:27'),
(331, 'underlinetwo@hotmail.com', 'วิโรจน์ ผลชนะ', '0891529419', 'วิโรจน์ ผลชนะ 0891529419 ครับอาจารย์ป๋วย\r\n\r\nชื่อนาย วิโรจน์ ผลชนะ ชื่อเล่น เป้ หมู่เลือด B\r\nเกิดวันเสาร์ที่ 1 ธันวาคม 2522 เวลา 21.45 น.\r\nจังหวัดสงขลา\r\n\r\nบ้านเลขที่อาศัยปัจจุบันกับพ่อแม่ 138/4\r\n\r\nบ้านเลขที่ปู่ย่าและยังมีชื่อของตัวเองอยู่ในทะเบียนบ้าน 132 (อยู่ห่างกันไม่เกิน 500 เมตร)\r\n\r\nรถจักรยานยนต์ สแมส สีน้ำเงิน-ดำ เลขที่ คฉท 62 สงขลา\r\n\r\nตอนนี้มีวัตถุมงคลอยู่บางอย่าง เก็บอยู่ในกล่อง ยังไม่ได้ตั้งหิ้งบูชา เพราะกลัวพ่อกับแม่จะแปลกใจ ว่าตัวเองมีของเหล่านี้ด้วย ได้ยังไง\r\n- พระพิฆเนศทองเหลือง ขนาดจิ๋ว\r\n- ตะกรุด ยันต์เกราะเพชร อิติปิโส\r\n- ขุนแผนยอดขุนพลพรายกุมาร ในน้ำมัน\r\n- กุมารทอง ขนาดเล็ก เนื้อโลหะ\r\n- กุมารี ขนาดเล็ก เนื้อว่าน ในน้ำมัน\r\n- แหวนเงินหมอกมุงเมือง\r\n- แหวนเงินแก้วขนเหล็ก\r\n- แก้วขนเหล็ก\r\n\r\nตอนนี้ก็กำลังรอที่จะเปลี่ยนชื่อใหม่อยู่ น่าจะได้ชื่อช่วงต้นเดือนหน้า เห็นเขาว่าจะมีให้เราได้เลือกเองอีก สัก 2-3 ชื่อ\r\n\r\nที่ผ่านมาเวลาไปถามหมอดูเรื่องคู่ครอง ส่วนใหญ่หลายหมอดูจะบอกว่าต้องรอ และเกณฑ์คู่ครองจะเป็นแบบว่าผู้ใหญ่\r\nจัดหามาให้ แต่ใจจริงของผม อยากมีโอกาสพบเจอเองซะมากกว่า เพราะว่าคู่ชีวิตคือคนที่ต้องอยู่กับเราไปตลอดชีวิต\r\nไม่ใช่ว่าคบหาแต่งงานกันไป เพราะความเกรงอกเกรงใจผู้หลักผู้ใหญ่ และก็กลัวด้วยว่าฝ่ายหญิงจะฝืนทนอยู่โดยไม่ได้รัก\r\n\r\nด้วยความเคารพ\r\nวิโรจน์ ผลชนะ (เป้)\r\n0891529419\r\nunderlinetwo@hotmail.com', '2014-04-10 10:43:00'),
(332, 'Preeapa@gmail.com', 'ปรีอาภา หอมเนียม', '0884801240', 'อยากทราบเบอร์ติดต่อกับกับเจ้าหน้าที่ค่ะ\r\nอยากปรึกษาเกี่ยวกับเรื่องเบอร์หน่อยค่ะ', '2014-04-10 15:05:53'),
