(340, 'sayan.polpim@gmail.com', 'คุณโต้ง ', '0846569592', 'ผมกำลังหาเบอร์ใหม่ให้คุณแม่ผมครับ \r\nแม่ผมทำงานเป็นเรขาผู้บริหารครับ \r\nผมเลือกเบอร์ 0924922939 ครับ \r\nให้ผมโอนเงินจำนวนเท่าไหร่ครับ เพราะต้องมีค่าส่ง EMS  ด้วยใช่ป่าวครับ  (ผมจองเบอร์ในระบบแล้วครับ)', '2014-05-06 15:13:30'),
