(344, 'purchase@gracebio.co.th', 'คริษฐา  นนทนาพันธ์', '089-459-0249', 'อยากจะทราบว่าเบอร์ 084-719-3645 มีคนเปิดใช้ไปแล้วหรือยัง ถ้าจองจะใช้เวลาในการส่งกี่วัน ราคา 1,990 บาท หรือเปล่า เป็นระบบ AIS ใช้ได้กับเครื่องโทรศัพท์ทุกรุ่นหรือเปล่า (ด่วนค่ะ)', '2014-05-19 16:39:26'),
(345, 'atidtarn@hotmail.com', 'อธิษฐาน', '0909695642', 'สวัสดีค่ะคุณป๋วย ไม่ได้คุยกันนานนะคะ แต่ดิฉันก็ยังแวะเวียนเว็บของคุณอยู่ อิอิ วันนี้ก็มีเรื่องรบกวนค่ะ เอาแบบเข้าประเด็นเลยละกันนะคะ คือดิฉันอยากแลกเปลี่ยนเบอร์โทรศัพท์ที่คุณมีอยู่ 1 เบอร์ คือเบอร์ 0946424795 ค่ะ โดยจะขอแลกจากเบอร์ที่ดิฉันมีอยู่ดังต่อไปนี้ หากว่าคุณป๋วยจะกรุณานะคะ ทั้งหมดเป็น ais ค่ะ\r\n\r\n0925252935\r\n\r\n0925915966\r\n\r\n0925915969\r\n\r\n0925254656\r\n\r\n0879369093\r\n\r\n0879495991\r\n\r\n0890962294\r\n\r\n0915636342\r\n\r\n0924419493\r\n\r\n0924562971\r\n\r\nขอบคุณค่ะ\r\n\r\nอนึ่ง ถ้าฝากขายด้วย(ถ้าเป็นไปได้ จะคิดหักค่าเปอร์เซ็นต์ยังไงไหมคะ?)', '2014-05-22 22:29:35'),
(346, 'bebe_nu_belle@hotmail.com', 'คุณเล็ก', '0897670652', 'สอบถามเรื่องเบอร์ที่จองไว้ชื่อ คุณเล็กนะค่ะ สาม เบอร์ \r\n-ต้องเเจ้งอะไรเพิ่มเติมไหม\r\n- ต้องทำอะไรอีกบ้างไหมค่ะ', '2014-05-26 10:08:47'),
