(349, 'bunyarat.b@gmail.com', 'bunyarat', '0841551592', 'พอดีเพิ่งมีเพื่อนแนะนำเวปอาจารย์มาค่ะ อยากสอบถามว่าเพิ่งซื้อเบอร์มาให้คุณแม่ และแม่แฟนใช้ก่อนที่จะมาเจอเวปอาจารย์  พอเอาเข้าเช้คระบบของเวปอาจารย์ ขึ้นเป็นตัวสีส้ม สีเหลือง คือเบอรฺควรเปลี่ยนอีกมั้ยคะ?หรือเบอร์ไม่เสียมากสามารถใช้ได้ \r\n0855639287\r\n0829564478', '2014-06-02 01:38:18'),
(350, 'mcu_love@hotmail.com', 'ariyha   veerapong', '0897794855', 'ผมมีความต้องการใช้เบอร์แทนเบอร์เดิมให้เหมาะกับอาชีพ ธนาคาร  ควรใช้เบอร์แบบไหนครับ', '2014-06-10 20:28:44'),
