(352, 'maymayka555@gmail.com', 'สุภัทรา อู่วัฒนสกุล', '0876837348', '0955194465    <<  อยากจองเบอร์นี้สามารถใช้ได้หรือไม่ค่ะ\r\nสุภัทรา อู่วัฒนสกุล (เมย์)\r\n18 เม.ย 2533 \r\nเกิด พุธ กลางวัน หลังเที่ยง ปีมะเมีย \r\n\r\nอยากทราบว่า เบอร์นี้ดิฉันสามารถใช้ได้หรือไม่ เนื่องจาก ทำงานเกี่ยวกับการเจรจาค้าขาย หลายอย่าง ตอนนี้งานหลักคือ programmer IT ,Marketing ,sale  หากมีเวลารบกวนตรวจสอบให้หน่อยได้ไหมค่ะ  มีความประสงจะเปลี่ยนงาน และเบอร์โทรศัพท์นะค่ะ เบอร์เดิมใช้อยู่  0876837348 ', '2014-06-14 20:09:30'),
