(354, 'rossarin.chaiyasa@gmail.com', 'รสรินทร์ ไชยสา', '0806007229', 'อยากได้เบอร์ใหม่ที่สวยๆ ทำให้ชีวิตของเราดีขึ้นอย่างรวดเร็ว เนื่องจากดิฉันกำลังทำธุรกิจเกี่ยวกับ Network Marketing แต่รูสึกติดขัด ทั้งงานประจำ และทั้งธุรกิจแบบนี้ อยากได้เบอร์ที่ทำให้เรา มีการทำงานเกี่ยวกับธุรกิจได้รวดเร็วขึ้น ทำให้ได้รับความสุข 100% ประสบความสำเร็จกับธุรกิจโดยที่เร็วที่สุด รบกวนแนะนำด้วยนะค่ะ ขอบคุณค่ะ', '2014-07-01 11:33:50'),
(355, 'nannapas.v@mail.com', 'Nannapas V', '0819846433', 'อยากทรายว่าหลังจากจองเบอร์ไปแล้ว ต้องชำระภายในกี่วันถึงจะหลุดจอง หรือมีขั้นตอนยังไงคะ', '2014-07-03 22:19:06'),
